	add("shebeen", "{\"term\":\"shebeen\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Irish\"], \"text\":\"From Irish \u0027síbín\u0027 \u0026lt;!-- Compare \u0027seibin\u0027 (small mug; poor-qualty beer) --\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An unlicensed drinking establishment, especially in Ireland, Scotland, and South Africa\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1979\u0027\u0027, \u0027A Dry White Season\u0027, Vintage 1998, p. 178\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"‘Well, let\u0027s line,’ he said to Ben. ‘We can fill up at a \u0027\u0027shebeen\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, \u0027Long Walk to Freedom\u0027, Abacus 2010, p. 88\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"On almost every corner there were \u0027\u0027shebeens\u0027\u0027, illegal saloons that were shacks where home-brewed beer was served\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, \u0027Hitch-22\u0027, Atlantic 2011, p. 146\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Every night and day there were bombs and gunshots and riots and roundups, and it didn\u0027t take long to gain access to the bars and \u0027\u0027shebeens\u0027\u0027 where these things were discussed with a certain knowingness\", \"priority\":7}]}, \"synonyms\":{}}");

	add("sheep", "{\"term\":\"sheep\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"middle english (1100-1500)\", \"Persian\", \"northern frisian\", \"West Frisian\", \"Dutch\", \"old norse\", \"Ossetian\", \"Polish\", \"Albanian\", \"scythian\"], \"text\":\"From Middle english (1100-1500) {{m|enm|sheep}}, {{m|enm|scheep}}, {{m|enm|schep}}, {{m|enm|schepe}}, from Old english (ca. 450-1100) {{m|ang|scēap}}, from Proto-germanic {{m|gem-pro|*skēpą}} (compare West frisian {{m|fy|skiep}}, Northern frisian {{m|frr|schäip}}, Dutch {{m|nl|schaap}}, German {{m|de|Schaf}}), beside {{m|gem-pro|*keppô}} (compare Old norse {{m|non|kjappi||he-goat}}, dialectal German {{m|de|Kippe||newborn calf}}), of unknown origin. Perhaps from the same Scythian word (compare Ossetian {{m|os|цӕу||goat}}, Persian {{m|fa|چپش||yearling goat|tr\u003dčapiš}})\u0026lt;ref\u0026gt;Vladimir Orel, \u0027A Handbook of Germanic Etymology\u0027, s.vv. \u0026quot;*keppōn\u0026quot;, \u0026quot;*skēpan\u0026quot; (Leiden: Brill, 2003), 213, 340\u0026lt;/ref\u0026gt; which was borrowed into Albanian as {{m|sq|cjap}}, {{m|sq|sqap||he-goat}} and into Slavic (compare Polish {{m|pl|cap}}). After Kroonen, \u0027*skēpą\u0027 is instead from the root of Proto-Germanic {{m|gem-pro|*skabaną||to scratch}} via {{w|Kluge\u0027s law}}.\u0026lt;ref\u0026gt;Guus Kroonen (2011), \u0027The Proto-Germanic \u0027n-\u0027stems: a study in diachronic morphophonology\u0027 [http://books.google.de/books?id\u003d9stMq8rRnCMC], Rodopi, ISBN 9042032936.\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A woolly ruminant of the genus \u0027Ovis\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A timid, shy person who is easily led by others\", \"priority\":2}]}, \"synonyms\":{}}");

	add("sheet", "{\"term\":\"sheet\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"middle english (1100-1500)\", \"northern frisian\", \"Icelandic\", \"Dutch\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) \u0027schete\u0027 partly from Old english (ca. 450-1100) {{m|ang|scēte}}, {{m|ang|scȳte}}, {{m|ang|scīte||a sheet, a piece of linen cloth}}; partly from Old english (ca. 450-1100) {{m|ang|scēata||a corner, angle; the lower corner of a sail, sheet}}; and Old english (ca. 450-1100) {{m|ang|scēat||a corner, angle}}; all from Proto-germanic {{m|gem-pro|*skautijǭ}}, {{m|gem-pro|*skautaz||corner, wedge, lap}}, from Proto-indo-european {{m|ine-pro|*(s)kewd-||to throw, shoot, pursue, rush}}. Cognate with Northern frisian \u0027skut\u0027 (the fold of a garment, lap, coattail) Dutch \u0027schoot\u0027 (the fold of a garment, lap, sheet) German low german \u0027schote\u0027 (a line from the foot of a sail) German \u0027schoß\u0027 (the fold of a garment, lap) Swedish \u0027sköt\u0027 (sheet) Icelandic \u0027skaut\u0027 (the corner of a cloth, a line from the foot of a sail, the skirt or sleeve of a garment, a hood)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A thin bed cloth used as a covering for a mattress or as a layer over the sleeper\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Use the \u0027\u0027sheets\u0027\u0027 in the hall closet to make the bed\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Bible, Acts x. 10, 1\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"He fell into a trance, and saw heaven opened, and a certain vessel descending unto him, as it had been a great \u0027\u0027sheet\u0027\u0027 knit at the four corners\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"If I do die before thee, prithee, shroud me / In one of those same \u0027\u0027sheets\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A piece of paper, usually rectangular, that has been prepared for writing, artwork, drafting, wrapping, manufacture of packaging (boxes, envelopes, etc.), and for other uses. The word does not include scraps and irregular small pieces destined to be recycled, used for stuffing or cushioning or paper mache, etc\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027sheet\u0027\u0027 of paper measuring eight and one-half inches wide by eleven inches high is a popular item in commerce\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Paper is designated “20 pound” if a stack (ream) of 500 \u0027\u0027sheets\u0027\u0027 22 inches by 17 inches weighs 20 pounds\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A flat metal pan, often without raised edge, used for baking\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Place the rolls on the cookie \u0027\u0027sheet\u0027\u0027, edges touching, and bake for 10-11 minutes\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A thin, flat layer of solid material\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The glazer cut several panes from a large \u0027\u0027sheet\u0027\u0027 of glass\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027sheet\u0027\u0027 of that new silicon stuff is as good as a \u0027\u0027sheet\u0027\u0027 of tinfoil to keep food from sticking in the baking pan\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A broad, flat expanse of a material on a surface\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Mud froze on the road in a solid \u0027\u0027sheet\u0027\u0027, then more rain froze into a \u0027\u0027sheet\u0027\u0027 of ice on top of the mud\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A line (rope) used to adjust the trim of a sail\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"To be \u0026quot;three sheets to the wind\u0026quot; is to say that a four-cornered sail is tethered only by one \u0027\u0027sheet\u0027\u0027 and thus the sail is useless\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"A sail\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"The area of ice on which the game of curling is played\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"A layer of veneer\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"Precipitation of such quantity and force as to resemble a thin, virtually solid wall\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"An extensive bed of an eruptive rock intruded between, or overlying, other strata\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"The space in the forward or after part of a boat where there are no rowers\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"fore \u0027\u0027sheets\u0027\u0027; stern \u0027\u0027sheets\", \"priority\":25}]}, \"synonyms\":{}}");

