	add("sheetrock", "{\"term\":\"sheetrock\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\u0027sheet\u0027 + \u0027rock\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Drywall; plasterboard; a building material comprising a layer of gypsum plaster sandwiched between two pieces of heavy paper, used mainly for interior walls and ceilings\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any of the various thicknesses and grades of such material\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A wall made of this\", \"priority\":3}]}, \"synonyms\":{}}");

	add("sheets", "{\"term\":\"sheets\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"collective Collective noun meaning a large amount, when used of rain, or other precipitation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"When I looked out, all I could see were \u0027\u0027sheets\u0027\u0027 of rain\", \"priority\":2}]}, \"synonyms\":{}}");

	add("sheffield", "{\"term\":\"sheffield\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Old English for \u0027open land by the river Sheaf\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A city in South Yorkshire, England, United Kingdom\", \"priority\":1}]}, \"synonyms\":{}}");

	add("sheikdom", "{\"term\":\"sheikdom\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|sheik|dom|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The domain ruled by a sheik\", \"priority\":1}]}, \"synonyms\":{}}");

	add("sheinwoodian", "{\"term\":\"sheinwoodian\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A subdivision of the Silurian period\", \"priority\":1}]}, \"synonyms\":{}}");

	add("sheitel", "{\"term\":\"sheitel\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\", \"Yiddish\"], \"text\":\"From Yiddish \u0027שייטל\u0027 from German \u0027scheitel\u0027 (parting) {{attention|yi|really from de, or from a common ancestor?}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A wig worn by orthodox, married, Jewish women\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Howard Jacobson, \u0027Kalooki Nights\u0027, Vintage 2007, p. 196\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I keep wanting to put her in a \u0027\u0027sheitel\u0027\u0027, the wig that every Orthodox Jewish wife is supposed to wear in order to prevent a man not her husband from lusting after her in his heart\", \"priority\":3}]}, \"synonyms\":{}}");

	add("shekel", "{\"term\":\"shekel\", \"etymology\":{\"influencers\":[], \"languages\":[\"akkadian\", \"English\", \"Hebrew\"], \"text\":\"From Hebrew \u0027lang\u003dhe|שֶׁקֶל\u0027 (shekel) from \u0027lang\u003dhe|שָׁקַל|tr\u003dshakál\u0027 () from Akkadian \u0027lang\u003dakk\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A currency unit of both ancient and modern Israel\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"money\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An ancient unit of weight equivalent to one-fiftieth of a mina\", \"priority\":3}]}, \"synonyms\":{}}");

	add("shelf", "{\"term\":\"shelf\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"Probably from Old english (ca. 450-1100) {{m|ang|scylfe||deck of a ship}}; distantly related to \u0027\u0027 \u0027\u0027 and \u0027\u0027 Cognate to Dutch {{m|nl|schelf}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A flat, rigid, rectangular structure, fixed at right angles to a wall, and used to support, store or display objects\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027 October 31, David M. Halbfinger, \u0026quot;[http://www.nytimes.com/2012/11/01/nyregion/new-jersey-continues-to-cope-with-hurricane-sandy.html?hp],\u0026quot; \u0027New York Times\u0027 \u0026lt;small\u0026gt;(retrieved 31 October 2012)\u0026lt;/small\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Localities across New Jersey imposed curfews to prevent looting. In Monmouth, Ocean and other counties, people waited for hours for gasoline at the few stations that had electricity. Supermarket \u0027\u0027shelves\u0027\u0027 were stripped bare\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The capacity of such an object; as, a shelf of videos\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A projecting ledge that resembles such an object\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A reef, shoal or sandbar\", \"priority\":6}]}, \"synonyms\":{}}");

	add("shell", "{\"term\":\"shell\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027schelle\u0027 from Old english (ca. 450-1100) (Anglian) \u0027scell\u0027 \u0027eggshell, seashell\u0027, (South) \u0027sciell\u0027 \u0027sciel\u0027 from Proto-germanic {{m|gem-pro|*skaljō}} (compare West Frisian \u0027skyl\u0027 (peel, rind) Dutch \u0027schil\u0027 (peel, skin, rink) Low German \u0027schell\u0027 (shell, scale) , from Proto-indo-european {{m|ine-pro|*(s)kelH-||to split, cleave}} (compare Irish \u0027scelec\u0027 (pebble) Latin \u0027silex\u0027 (pebble, flint) \u0027siliqua\u0027 (pod) Old Church Slavonic \u0027сколика\u0027 (shell) . More at \u0027shale\u0027 Doublet of \u0027sheal\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A hard external covering of an animal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The calcareous or chitinous external covering of mollusks, crustaceans, and some other invertebrates\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In some mollusks, as the cuttlefish, the \u0027\u0027shell\u0027\u0027 is concealed by the animal\u0027s outer mantle and is considered internal\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Genuine mother of pearl buttons are made from sea \u0027\u0027shells\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Any mollusk having such a covering\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The exoskeleton or wing covers of certain insects\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The conjoined scutes that comprise the \u0026quot;shell\u0026quot; (carapace) of a tortoise or turtle\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The overlapping hard plates comprising the armor covering the armadillo\u0027s body\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The hard calcareous covering of a bird egg\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The hard external covering of various plant seed forms\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The covering, or outside part, of a nut\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The black walnut and the hickory nut, both of the same \u0027Genus\u0027 as the pecan, have much thicker and harder \u0027\u0027shells\u0027\u0027 than the pecan\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A pod containing the seeds of certain plants, such as the legume \u0027Phaseolus vulgaris\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Husks of cacao seeds, a decoction of which is sometimes used as a substitute or adulterant for cocoa and its products such as chocolate\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"The accreted mineral formed around a hollow geode\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The casing of a self-contained single-unit artillery projectile\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A hollow usually spherical or cylindrical projectile fired from a siege mortar or a smoothbore cannon. It contains an explosive substance designed to be ignited by a fuse or by percussion at the target site so that it will burst and scattered at high velocity its contents and fragments. Formerly called a bomb\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"The cartridge of a breechloading firearm; a load; a bullet; a round\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Any slight hollow structure; a framework, or exterior structure, regarded as not complete or filled in, as the \u0027\u0027shell\u0027\u0027 of a house\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"A garment, usually worn by women, such as a shirt, blouse, or top, with short sleeves or no sleeves, that often fastens in the rear\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"A coarse or flimsy coffin; a thin interior coffin enclosed within a more substantial one\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"A string instrument, as a lyre, whose acoustical chamber is formed like a shell\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"The first lyre may have been made by drawing strings over the underside of a tortoise shell\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"Dryde\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"when Jubal struck the chorded \u0027\u0027shell\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"The body of a drum; the often wooden, often cylindrical acoustic chamber, with or without rims added for tuning and for attaching the drum head\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"An engraved copper roller used in print works\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"The watertight outer covering of the hull of a vessel, often made with planking or metal plating\", \"priority\":28},{\"upperType\":\"NOUN\", \"text\":\"The outer frame or case of a block within which the sheaves revolve\", \"priority\":29},{\"upperType\":\"NOUN\", \"text\":\"A light boat whose frame is covered with thin wood, impermeable fabric, or water-proofed paper; a racing shell or dragon boat\", \"priority\":30},{\"upperType\":\"NOUN\", \"text\":\"An operating system software user interface, whose primary purpose is to launch other programs and control their interactions; the user\u0027s command interpreter\", \"priority\":31},{\"upperType\":\"NOUN\", \"text\":\"The name \u0027\u0027shell\u0027\u0027 originates from it being viewed as an outer layer of interface between the user and the internals of the operating system\", \"priority\":32},{\"upperType\":\"NOUN\", \"text\":\"The name \u0026quot;Bash\u0026quot; is an acronym which stands for \u0026quot;Bourne-again shell\u0026quot;, itself a pun on the name of the \u0026quot;Bourne shell\u0026quot;, an earlier Unix \u0027\u0027shell\u0027\u0027 designed by Stephen Bourne, and the Christian concept of being \u0026quot;born again\u0026quot\", \"priority\":33},{\"upperType\":\"NOUN\", \"text\":\"A set of atomic orbitals that have the same principal quantum number\", \"priority\":34},{\"upperType\":\"NOUN\", \"text\":\"An emaciated person\", \"priority\":35},{\"upperType\":\"NOUN\", \"text\":\"He\u0027s lost so much weight from illness; he\u0027s a \u0027\u0027shell\u0027\u0027 of his former self\", \"priority\":36},{\"upperType\":\"NOUN\", \"text\":\"A psychological barrier to social interaction\", \"priority\":37},{\"upperType\":\"NOUN\", \"text\":\"Even after months of therapy he\u0027s still in his \u0027\u0027shell\", \"priority\":38},{\"upperType\":\"NOUN\", \"text\":\"A legal entity that has no operations\", \"priority\":39},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027shell\u0027\u0027 corporation was formed to acquire the old factory\", \"priority\":40},{\"upperType\":\"NOUN\", \"text\":\"A concave rough cast-iron tool in which a convex lens is ground to shape\", \"priority\":41},{\"upperType\":\"NOUN\", \"text\":\"A gouge bit or shell bit\", \"priority\":42}]}, \"synonyms\":{}}");

