	add("shelfmark", "{\"term\":\"shelfmark\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|shelf|mark|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A usually alphanumeric code indicating the physical location of a book within a library\", \"priority\":1}]}, \"synonyms\":{}}");

	add("shelfware", "{\"term\":\"shelfware\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|shelf|ware|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A piece of software that has never been used at all since its creation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A piece of software created for the sole purpose of being immediately shelved\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Software purchased but not used\", \"priority\":3}]}, \"synonyms\":{}}");

