	add("shelley", "{\"term\":\"shelley\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"From Old english (ca. 450-1100) meaning \u0026quot;clearing on a bank\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Percy Bysshe Shelley (1792-1822), a Romantic poet\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"transferred use of the surname, mostly before 1930\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"used since the 1930s, also explained as a variant of Shirley or Michelle\", \"priority\":3}]}, \"synonyms\":{}}");

	add("shells", "{\"term\":\"shells\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"She sells sea \u0027\u0027shells\u0027\u0027 by the sea shore, but the \u0027\u0027shells\u0027\u0027 she sells aren\u0027t sea \u0027\u0027shells\u0027\u0027, I\u0027m sure\", \"priority\":1}]}, \"synonyms\":{}}");

	add("shelltoes", "{\"term\":\"shelltoes\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|shell|toes|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A style of basketball shoe with a segmented rubber upper resembling a seashell\", \"priority\":1}]}, \"synonyms\":{}}");

	add("sheloshim", "{\"term\":\"sheloshim\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Hebrew\"], \"text\":\"From the Hebrew {{m|he|שְׁלוֹשִׁים||tr\u003dshloshím|thirty}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A period of thirty days after the burial of a deceased person, during which a mourner is forbidden to do certain things, such as marrying or shaving\", \"priority\":1}]}, \"synonyms\":{}}");

	add("shelter", "{\"term\":\"shelter\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) {{m|enm|sheltron}}, {{m|enm|sheldtrume||roof or wall formed by locked shields}}, from Old english (ca. 450-1100) {{m|ang|scildtruma}}, {{m|ang|scyldtruma||a phalanx, company (of troops), a tortoise, a covering, shed, shelter|lit\u003dshield-troop}}, from {{m|ang|scyld}}, {{m|ang|scield||shield}} + {{m|ang|truma||a troop of soldiers}}. Cognate with Scots {{m|sco|schilthrum}}, {{m|sco|schiltrum}}. More at {{l/en|shield}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A refuge, haven or other cover or protection from something\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An institution that provides temporary housing for homeless people, battered women etc\", \"priority\":2}]}, \"synonyms\":{}}");

	add("shemagh", "{\"term\":\"shemagh\", \"etymology\":{\"influencers\":[], \"languages\":[\"Arabic\", \"English\"], \"text\":\"British military use, from Arabic \u0027شْمَاغ\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A headcloth designed for a desert environment to protect the wearer from sand and heat\", \"priority\":1}]}, \"synonyms\":{}}");

	add("shemaiah", "{\"term\":\"shemaiah\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient hebrew\"], \"text\":\"From the Ancient hebrew {{m|he|שְׁמַעְיָה||[whom] God heard}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of several people in the Tanakh, and Christian Old Testament\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A prophet in the reign of Rehoboam (1 Kings 12:22-24\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Neh. 3:29\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A Simeonite (1 Chr. 4:37\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A priest (Neh. 12:42\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A Levite (1 Chr. 9:16\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1 Chr. 9:14; Neh. 11:15\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A Levite in the time of David, who with 200 of his brethren took part in the bringing up of the ark from Obed-edom to Hebron (1 Chr. 15:8\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A Levite (1 Chr. 24:6\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The eldest son of Obed-edom (1 Chr. 26:4-8\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A Levite (2 Chr. 29:14\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A false prophet who hindered the rebuilding of Jerusalem (Neh. 6:10\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A prince of Judah who assisted at the dedication of the wall of Jerusalem (Neh. 12:34-36\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A false prophet who opposed Jeremiah (Jer. 29:24-32\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"One of the Levites whom Jehoshaphat appointed to teach the law (2 Chr. 17:8\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"A Levite appointed to \u0026quot;distribute the oblations of the Lord\u0026quot; (2 Chr. 31:15\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A Levite (2 Chr. 35:9\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"The father of Urijah the prophet (Jer. 26:20\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"The father of a prince in the reign of Jehoiakim (Jer. 36:12\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"A rabbinic sage who was leader of the Pharisees in 1st century BC\", \"priority\":20}]}, \"synonyms\":{}}");

	add("shemale", "{\"term\":\"shemale\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|she|male|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A male-to-female transsexual or transgender person\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A male animal which displays female traits or behaviors; for example, a male reptile which gives off female pheromones\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, R. Shine, B. Phillips, H. Waye, M. LeMaster, R. T. Mason, \u0027Benefits of female mimicry in snakes\u0027, in \u0027Nature\u0027 (414, 267\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"She-male\u0027\u0027 garter snakes exploit the amorous attentions of other males to warm up\", \"priority\":4}]}, \"synonyms\":{}}");

	add("shenanigan", "{\"term\":\"shenanigan\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\", \"French\", \"Irish\", \"pfaelzisch\"], \"text\":\"Of uncertain origin. These possibilities have been suggested:* Irish \u0027sionnachuighim|lang\u003dga\u0027 () * Spanish \u0027chanada\u0027 () a shortening of \u0027charranada\u0027 (lang\u003des) * Pfaelzisch \u0027schinägeln\u0027 (lang\u003dpfl) from the peddler\u0027s argot term {{m|pfl||Schenigelei|work}}.* French \u0027manigance\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A deceitful confidence trick, or mischief causing discomfort or annoyance\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"I spotted his next \u0027\u0027shenanigan\u0027\u0027 — saw it coming — and so avoided being fooled\", \"priority\":2}]}, \"synonyms\":{}}");

	add("shenzhen", "{\"term\":\"shenzhen\", \"etymology\":{\"influencers\":[], \"languages\":[\"mandarin chinese\", \"English\"], \"text\":\"From Mandarin chinese \u0027深圳\u0027 from \u0027深\u0027 (deep) + \u0027圳\u0027 (irrigation ditch)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sub-provincial city in the south-east of China, the third largest city, in the province of Guangdong\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"In 1979 Shenzhen was a small border city of some 30,000 inhabitants that served as a customs stop into mainland China from Hong Kong. (\u0027Encyclopædia Britannica\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The first four special economic zones were created in 1980 in southeastern coastal China and consisted of what were then the small cities of Shenzhen, Zhuhai, and Shantou in Guangdong province and Xiamen (Amoy) ... (\u0027Encyclopædia Britannica\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Shenzhen municipal government will give top priority to developing its modern logistics and finance sectors and building the industries into the city\u0027s pillar sectors in the following years. (\u0027China Daily; November 8, 2006\", \"priority\":4}]}, \"synonyms\":{}}");

	add("sheol", "{\"term\":\"sheol\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Hebrew\"], \"text\":\"From Hebrew שיול (sheol), meaning \u0026quot;abode of the dead\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Old Testament)\u0027 the realm of dead, the common grave of mankind, Hell. In older English translations of the Bible, notably the Authorized or King James Bible, this word is translated as grave or pit\", \"priority\":1}]}, \"synonyms\":{}}");

	add("shepherd", "{\"term\":\"shepherd\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"From Old english (ca. 450-1100) {{m|ang|scēaphierde}}, a compound of {{m|ang|scēap||sheep}} and {{m|ang|hierde||herdsman}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who tends sheep, especially a grazing flock\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"It was April 22, 1831, and a young man was walking down Whitehall in the direction of Parliament Street. He wore \u0027\u0027shepherd\u0027\u0027s plaid trousers and the swallow-tail coat of the day, with a figured muslin cravat wound about his wide-spread collar\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Someone who watch watches over, look looks after, or guides somebody\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1769\u0027\u0027, Oxford Standard text, \u0027s:Bible (King Bible (King James)\u0027, \u0027s:Bible (King Psalms\u0027, 23, i\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The LORD is my \u0027\u0027shepherd\u0027\u0027; I shall not want\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The pastor of a church; one who guides others in religion\", \"priority\":6}]}, \"synonyms\":{}}");

	add("shepherdess", "{\"term\":\"shepherdess\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|shepherd|ess|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A female shepherd\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A large and deep armchair with a cushion\", \"priority\":2}]}, \"synonyms\":{}}");

	add("sheqel", "{\"term\":\"sheqel\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Hebrew\"], \"text\":\"From Hebrew \u0027lang\u003dhe\u0027 from \u0027lang\u003dhe|שָׁקַל|tr\u003dshaqal\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A currency unit of both ancient and modern Israel\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"money\", \"priority\":2}]}, \"synonyms\":{}}");

	add("shero", "{\"term\":\"shero\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|she|hero|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A female hero\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title \u003d Dave Chappelle \u0026amp; Maya Angelou series \u003d season \u003d 2 number \u003d 6 network \u003d Sundance passage \u003d Every human grouping, whether it\u0027s just two people, a family, people in the neighborhood, people in the city, in a nation, a tribe, a species; people live in direct relation to the heroes and the \u0027\u0027sheroes\u0027\u0027 they have\", \"priority\":2}]}, \"synonyms\":{}}");

	add("sherbet", "{\"term\":\"sherbet\", \"etymology\":{\"influencers\":[], \"languages\":[\"Arabic\", \"English\", \"Persian\", \"ottoman turkish (1500-1928)\", \"Turkish\"], \"text\":\"Turkish {{m|tr|şerbet}}, from Ottoman turkish (1500-1928) {{m|ota|شربت|tr\u003dşerbet}}, from Persian {{m|fa|شربت|tr\u003dšarbat||sharbat}}, from Arabic {m|ar|شَرْبَة||drink}}.\u0026lt;ref\u0026gt;[http://dictionary.reference.com/browse/sherbet \u0026quot;sherbet.\u0026quot;] Dictionary.com Unabridged (v 1.1). Random House, Inc. 2008.\u0026lt;/ref\u0026gt;Cognate to {{m|en|sorbet}}, related to {{m|en|syrup}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A food of frozen fruit juice with a dairy product such as milk added; a sorbet with dairy ingredients\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A powder made of bicarbonate of soda, sugar and flavourings, intended to be eaten alone or mixed with water to make a drink\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A traditional West and South Asian sweet drink prepared from fruits or flower petals\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1895\u0027\u0027, Oswald Hutton Parry, \u0027Six Months in a Syrian Monastery\u0027 [2004 reprint], [https://books.google.hu/books?id\u003dkVYJE_OcjV8C\u0026amp;pg\u003dPA86\u0026amp;dq\u003d%22sherbet%2\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22sherbet%22\u0026amp;f\u003dfalse page 86\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Tea is becoming a favourite drink in Turkey, not instead of coffee, but of the \u0027\u0027sherbet\u0027\u0027 or cool drinks that are handed to guests; it comes generally from Russia, and although a trifle dear on account of the carriage, is extremely good, when properly made\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Anna Suranyi, \u0027The Genius of the English Nation: Travel Writing and National Identity in Early Modern England\u0027, [https://books.google.hu/books?id\u003dDcV8ZE6uz7MC\u0026amp;pg\u003dPA102\u0026amp;dq\u003d%22sherbet%22+cold\u0026amp;hl\u003dhu\u0026amp;sa\u003dX\u0026amp;ei\u003dWuv1VM_LAoa7OI7hgYgD\u0026amp;ved\u003d0CC0Q6AEwAjg\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22sherbet%22%20cold\u0026amp;f\u003dfalse page 101–102\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The beverages of the Turks were an interesting exception to their reputation for simple foods. While many writers mentioned the Turkish penchant for drinking “cleere water,” in light of the prohibitions against alcohol (although some writers, usually those who were more negatively inclined against the Turks, maintained that they were drunkards in secret), virtually all authors discussed the nonalcoholic drinks made by the Turks to replace alcohol, not only coffee, but also sweet refined drinks such as \u0027\u0027sherbet\u0027\u0027, a cold drink that usually included sugar, water, and a fruity or flowery flavoring. \u0027\u0027Sherbet\u0027\u0027 was considered a delicacy, and it and other refined drinks were mentioned in detail by a number of travelers\", \"priority\":9}]}, \"synonyms\":{}}");

	add("sheriff", "{\"term\":\"sheriff\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"From Old english (ca. 450-1100) \u0027scirgerefa|scīrġerēfa\u0027, corresponding to \u0027shire\u0027 + \u0027reeve\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"High Sheriff) An official of a shire or county office, responsible for carrying out court orders, law enforcement and other duties\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A judge in the sheriff court, the court of a county or sheriffdom\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A government official, usually responsible for law enforcement in his county and for administration of the county jail, sometimes an officer of the court, usually elected\", \"priority\":3}]}, \"synonyms\":{}}");

	add("sheriffdom", "{\"term\":\"sheriffdom\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|sheriff|dom|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The regions in which a sheriff has authority\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Crossing the river got him beyond his old nemesis\u0027 \u0027\u0027sheriffdom\u0027\u0027 and into the territory of a more liberal authority\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The office, or period of office, of a sheriff\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"His \u0027\u0027sheriffdom\u0027\u0027 began with his election and ended with his death\", \"priority\":4}]}, \"synonyms\":{}}");

	add("sheriffhood", "{\"term\":\"sheriffhood\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027sherefhode\u0027 equivalent to {{suffix|sheriff|hood|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The office of sheriff\", \"priority\":1}]}, \"synonyms\":{}}");

	add("sherry", "{\"term\":\"sherry\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"Spanish\"], \"text\":\"From Middle english (1100-1500) \u0027sherris\u0027 (interpreted as plural), from Spanish (\u0027vino de\u0027) \u0027xeres\u0027 (wine of xeres) Xeres being the former name of \u0027jerez\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fortified wine produced in w:Jerez de la Jerez de la Frontera in Spain, or a similar wine produced elsewhere\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A variety of sherry\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"They produce several quality \u0027\u0027sherries\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A glass of sherry\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Would you like a \u0027\u0027sherry\", \"priority\":5}]}, \"synonyms\":{}}");

	add("sherwoodite", "{\"term\":\"sherwoodite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Sherwood|ite|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A tetragonal-ditetragonal dipyramidal mineral containing aluminum, calcium, hydrogen, oxygen, and vanadium\", \"priority\":1}]}, \"synonyms\":{}}");

	add("sheugh", "{\"term\":\"sheugh\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A ditch, especially a field boundary ditch usually used to drain fields and mark their boundaries\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The space between the buttocks\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The sweat is running down the \u0027\u0027sheugh\u0027\u0027 of my arse\", \"priority\":3}]}, \"synonyms\":{}}");

	add("shevat", "{\"term\":\"shevat\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The fifth month of the civil year in the Jewish calendar, after Tevet and before Adar\", \"priority\":1}]}, \"synonyms\":{}}");

